// SPDX-License-Identifier: LGPL-3.0-or-later
pragma solidity 0.8.3;

import "@openzeppelin/contracts/access/AccessControl.sol";

contract ContractsRegistry is AccessControl {
    bytes32 public constant CONTRACTS_REGISTRY_ADMIN_ROLE =
        keccak256("CONTRACTS_REGISTRY_ADMIN_ROLE");

    bytes32 public constant DISTRIBUTION_TOKEN_NAME = keccak256("DISTRIBUTION_TOKEN");
    bytes32 public constant TOKEN_FARMING_NAME = keccak256("TOKEN_FARMING");

    mapping(bytes32 => address) private _contracts;

    modifier onlyAdmin() {
        require(
            hasRole(CONTRACTS_REGISTRY_ADMIN_ROLE, msg.sender),
            "ContractsRegistry: Caller is not an admin"
        );
        _;
    }

    constructor() {
        _setupRole(CONTRACTS_REGISTRY_ADMIN_ROLE, msg.sender);
        _setRoleAdmin(CONTRACTS_REGISTRY_ADMIN_ROLE, CONTRACTS_REGISTRY_ADMIN_ROLE);
    }

    function getDistributionTokenContract() external view returns (address) {
        return getContract(DISTRIBUTION_TOKEN_NAME);
    }

    function getTokenFarmingContract() external view returns (address) {
        return getContract(TOKEN_FARMING_NAME);
    }

    function getContract(bytes32 _name) public view returns (address) {
        require(_contracts[_name] != address(0), "ContractsRegistry: This mapping doesn't exist");

        return _contracts[_name];
    }

    function addContract(bytes32 _contractKey, address _contractAddr) external onlyAdmin {
        require(_contractAddr != address(0), "ContractsRegistry: Null address is forbidden");

        _contracts[_contractKey] = _contractAddr;
    }

    function deleteContract(bytes32 _contractKey) external onlyAdmin {
        require(
            _contracts[_contractKey] != address(0),
            "ContractsRegistry: This mapping doesn't exist"
        );

        delete _contracts[_contractKey];
    }
}
